import React, { Component } from "react";

class Footer extends Component {
  state = {};
  render() {
    return (
      <div
        style={{
          paddingTop: 50,
          padding: 50,
          paddingBottom: 50,
          width: "100vw",
          height: "1vh",
        }}
        className="jumbotron jumbotron-fluid"
        className="text-right p-5"
      >
        <div className="container">
          <h2
            className="display-4"
            className="text-right text-dark pr-5 pt-5 mt-5"
          >
            Owner's message
          </h2>
          <p className="lead medium" className="text-left text-dark pr-5 mt-1">
            Need a talented individual to cover an <br />
            occasion? Browse through our list of curated <br />
            photographers or let us find one for you
          </p>
        </div>
      </div>
    );
  }
}

export default Footer;
